import * as React from 'react';
export function useAccordionItemContextValues_unstable(state) {
    const { disabled , onHeaderClick , open  } = state;
    const accordionItem = React.useMemo(()=>({
            disabled,
            onHeaderClick,
            open
        }), [
        disabled,
        onHeaderClick,
        open
    ]);
    return {
        accordionItem
    };
}
